"use strict";(self.webpackChunkaureole=self.webpackChunkaureole||[]).push([[247],{4193:(n,s,a)=>{a.r(s),a.d(s,{data:()=>e});const e={key:"v-e92459a0",path:"/config/sender.html",title:"Отправитель",lang:"en-US",frontmatter:{},excerpt:"",headers:[{level:2,title:"Конфигурация email отправителя.",slug:"конфигурация-email-отправителя",children:[{level:3,title:"Пример конфига",slug:"пример-конфига",children:[]}]},{level:2,title:"Конфигурация twilio отправителя.",slug:"конфигурация-twilio-отправителя",children:[{level:3,title:"Пример конфига",slug:"пример-конфига-1",children:[]}]}],filePathRelative:"config/sender.md",git:{contributors:[{name:"Semen Asaevich",email:"semen.asaevich@gmail.com",commits:4}]}}},2733:(n,s,a)=>{a.r(s),a.d(s,{default:()=>o});const e=(0,a(6252).uE)('<h1 id="отправитель" tabindex="-1"><a class="header-anchor" href="#отправитель" aria-hidden="true">#</a> Отправитель</h1><hr><p>Описывает все свойства данного отправителя. Данный плагин предоставляет возможность отправлять пользователям различные виды сообщений, будь то электронные письма или телефонные сообщения.</p><ul><li>Тип: <strong>object</strong>. Обязательны: <code>name</code>. Наличие дополнительных свойств: <strong>Недопустимо</strong>. <ul><li><code>name</code>: Тип: <strong>string</strong>. Дополнительно: Имя экземпляра плагина. Имя хранилища. Имя используется для того, чтобы в дальнейшем ссылаться на данный отправитель. Минимальная длина: <strong>1</strong>.</li></ul><h4 id="допустим-один-из-вариантов-конфига" tabindex="-1"><a class="header-anchor" href="#допустим-один-из-вариантов-конфига" aria-hidden="true">#</a> Допустим один из вариантов конфига</h4><h2 id="конфигурация-email-отправителя" tabindex="-1"><a class="header-anchor" href="#конфигурация-email-отправителя" aria-hidden="true">#</a> Конфигурация email отправителя.</h2><ul><li>Тип: <strong>object</strong>. Конфигурация email отправителя. Служит для задания свойств отправителя. Обязательны: <code>type</code>, <code>config</code>. Наличие дополнительных свойств: <strong>Недопустимо</strong>. <ul><li><code>type</code>: Константа: <strong>email</strong>. Тип отправителя. Необходим, чтобы дать Aureole понять, какой из отправителей использовать.</li><li><code>config</code>: Тип: <strong>object</strong>. Конфигурация отаправителя. Описывает все свойства данного отправителя. Обязательны: <code>host</code>, <code>username</code>, <code>password</code>, <code>from</code>, <code>templates</code>. Наличие дополнительных свойств: <strong>Недопустимо</strong>. <ul><li><code>host</code>: Тип: <strong>string</strong>. Хост. Хост сервера электронной почты.</li><li><code>username</code>: Тип: <strong>string</strong>. Дополнительно: Формат: Email. Имя пользователя. Имя пользователя для аутентификации на сервере электронной почты.</li><li><code>password</code>: Тип: <strong>string</strong>. Пароль пользователя. Пароль пользователя для аутентификации на сервере электронной почты. Минимальная длина: <strong>1</strong>.</li><li><code>insecure_skip_verify</code>: Тип: <strong>boolean</strong>. Значение по-умолчанию: <strong>False</strong>. Флаг отключения проверки сертификатов. Если включен, то при установлении соединения не будут проверяться сертификаты.</li><li><code>from</code>: Тип: <strong>string</strong>. Дополнительно: Формат: Email. Аккаунт отправителя. Аккаунт, от чьего имени будут отправляться письма этим отправителем.</li><li><code>bcc</code>: Тип: <strong>array</strong>. Значение по-умолчанию: <strong>[]</strong>. Список скрытых вторичных получателей письма. Список аккаунтов, которым будет направляться копия письма. Эти пользователи не показываются другим получателям. Элементы должны быть уникальными. <ul><li><strong>Элементы</strong>: Тип: <strong>string</strong>. Дополнительно: Формат: Email.</li></ul></li><li><code>cc</code>: Тип: <strong>array</strong>. Значение по-умолчанию: <strong>[]</strong>. Список вторичных получателей письма. Список аккаунтов, которым будет направляться копия письма. Эти пользователи видят и знают о наличии друг друга. Элементы должны быть уникальными. <ul><li><strong>Элементы</strong>: Тип: <strong>string</strong>. Дополнительно: Формат: Email.</li></ul></li><li><code>templates</code>: Тип: <strong>object</strong>. Перечисление шаблонов. Список шаблонов, которые могут быть использованы для отправки сообщений через этот отправитель. Минимальное кол-во свойств: <strong>1</strong>. <ul><li><code>regex(&quot;.+&quot;)</code>: Тип: <strong>string</strong>. Дополнительно: Путь к файлу, Расширение файла: txt,html. Минимальная длина: <strong>1</strong>.</li></ul></li></ul></li></ul><h3 id="пример-конфига" tabindex="-1"><a class="header-anchor" href="#пример-конфига" aria-hidden="true">#</a> Пример конфига</h3><div class="language-yaml ext-yml line-numbers-mode"><pre class="language-yaml"><code><span class="token key atrule">senders</span><span class="token punctuation">:</span>\n  <span class="token punctuation">-</span> <span class="token key atrule">type</span><span class="token punctuation">:</span> <span class="token string">&quot;email&quot;</span>\n    <span class="token key atrule">name</span><span class="token punctuation">:</span> email\n    <span class="token key atrule">config</span><span class="token punctuation">:</span>\n      <span class="token key atrule">host</span><span class="token punctuation">:</span> smtp.gmail.com<span class="token punctuation">:</span><span class="token number">587</span>\n      <span class="token key atrule">username</span><span class="token punctuation">:</span> username@example.com\n      <span class="token key atrule">password</span><span class="token punctuation">:</span> $<span class="token punctuation">{</span>SMTP_PASSWORD<span class="token punctuation">}</span>\n      <span class="token key atrule">from</span><span class="token punctuation">:</span> app@example.com\n      <span class="token key atrule">templates</span><span class="token punctuation">:</span>\n        <span class="token key atrule">txt_tmpl</span><span class="token punctuation">:</span> lab/templates/default.txt\n        <span class="token key atrule">html_tmpl</span><span class="token punctuation">:</span> lab/templates/default.html\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br></div></div></li></ul><h2 id="конфигурация-twilio-отправителя" tabindex="-1"><a class="header-anchor" href="#конфигурация-twilio-отправителя" aria-hidden="true">#</a> Конфигурация twilio отправителя.</h2><ul><li>Тип: <strong>object</strong>. Конфигурация twilio отправителя. Служит для задания свойств отправителя. Обязательны: <code>type</code>, <code>config</code>. Наличие дополнительных свойств: <strong>Недопустимо</strong>. <ul><li><code>type</code>: Константа: <strong>twilio</strong>. Тип отправителя. Необходим, чтобы дать Aureole понять, какой из отправителей использовать.</li><li><code>config</code>: Тип: <strong>object</strong>. Конфигурация отправителя. Описывает все свойства данного отправителя. Обязательны: <code>account_sid</code>, <code>auth_token</code>, <code>from</code>, <code>templates</code>. Наличие дополнительных свойств: <strong>Недопустимо</strong>. <ul><li><code>account_sid</code>: Тип: <strong>string</strong>. Идентификатор аккаунта. Идентификатор, полученный при регистрации аккаунт у провайдера. Минимальная длина: <strong>1</strong>.</li><li><code>auth_token</code>: Тип: <strong>string</strong>. Токен аккаунта. Токен, полученный при регистрации аккаунт у провайдера. Минимальная длина: <strong>1</strong>.</li><li><code>from</code>: Тип: <strong>string</strong>. Дополнительно: Формат: телефон. Номер телефона аккаунта. Номер, полученный при регистрации аккаунт у провайдера. От имени этого номера будут приходить сообщения. Минимальная длина: <strong>1</strong>.</li><li><code>templates</code>: Тип: <strong>object</strong>. Перечисление шаблонов. Список шаблонов, которые могут быть использованы для отправки сообщений через этот отправитель. Минимальное кол-во свойств: <strong>1</strong>. <ul><li><code>regex(&quot;.+&quot;)</code>: Тип: <strong>string</strong>. Дополнительно: Путь к файлу, Расширение файла: txt,html. Минимальная длина: <strong>1</strong>.</li></ul></li></ul></li></ul><h3 id="пример-конфига-1" tabindex="-1"><a class="header-anchor" href="#пример-конфига-1" aria-hidden="true">#</a> Пример конфига</h3><div class="language-yaml ext-yml line-numbers-mode"><pre class="language-yaml"><code><span class="token key atrule">senders</span><span class="token punctuation">:</span>\n  <span class="token punctuation">-</span> <span class="token key atrule">type</span><span class="token punctuation">:</span> <span class="token string">&quot;twilio&quot;</span>\n    <span class="token key atrule">name</span><span class="token punctuation">:</span> twilio\n    <span class="token key atrule">config</span><span class="token punctuation">:</span>\n      <span class="token key atrule">account_sid</span><span class="token punctuation">:</span> $<span class="token punctuation">{</span>TEST_TWILIO_ACCOUNT_SID<span class="token punctuation">}</span>\n      <span class="token key atrule">auth_token</span><span class="token punctuation">:</span> $<span class="token punctuation">{</span>TEST_TWILIO_AUTH_TOKEN<span class="token punctuation">}</span>\n      <span class="token key atrule">from</span><span class="token punctuation">:</span> $<span class="token punctuation">{</span>TEST_TWILIO_PHONE_NUMBER<span class="token punctuation">}</span>\n      <span class="token key atrule">templates</span><span class="token punctuation">:</span>\n        <span class="token key atrule">phone_otp</span><span class="token punctuation">:</span> lab/templates/phone_otp.txt\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br></div></div></li></ul></li></ul>',4),t={},o=(0,a(3744).Z)(t,[["render",function(n,s){return e}]])},3744:(n,s)=>{s.Z=(n,s)=>{for(const[a,e]of s)n[a]=e;return n}}}]);